import React from "react";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../../Theme/themes";
import { BrandType } from "../../../types/brand";
import TourItem from "../TourItem";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type TourStoryProps = {
    mode: string,
    brand: BrandType,
    title: string,
    subtitle: string,
    partialPrice: string,
    taxesIncluded: boolean,
    parcel: string,
    discount: string,
    attribute: string,
    label: string,
    link: string,
    isActive: boolean,
    stars: number,
    parcelInfo: string,
    more: string,
}

const TourStory = ({
    mode, 
    brand,
    title,
    subtitle,
    partialPrice,
    taxesIncluded,
    parcel,
    discount,
    attribute,
    label,
    link,
    isActive,
    stars,
    parcelInfo,
    more,
}: TourStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="Tour">
                <Typography variant="h3">Tour</Typography>
                <br />
                <Divider />
                <br />
                <TourItem
                    onClick={() => { } }
                    isFavorite
                    title={title}
                    subtitle={subtitle}
                    partialPrice={partialPrice}
                    taxesIncluded={taxesIncluded}
                    parcel={parcel}
                    imgs={["https://s3.amazonaws.com/cvc-bancodeimagens/destinos/foz-do-iguacu-cataratas-natureza-vista-de-cima-pr-brasil-316241720.jpg"]}
                    cloudinarySettings="e_trim/w_400,ar_1:1,c_fill,g_auto/e_sharpen/q_auto,f_auto,fl_lossy"
                    totalAvaliations={["PARIS", "BORDEAUX", "MADRI", "BARCELONA NICE", "ROMA"]}
                    discount={discount}
                    attribute={attribute}
                    label={label}
                    link={link}
                    key="Tour" 
                    isActive={isActive}
                    stars={stars} 
                    className={undefined} 
                    parcelInfo={parcelInfo}
                    id={undefined} 
                    more={more}
                    onDetail={() => { } }
                    onViewMore={() => { } }          
                />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
        title: "ESPANHA E ROMA - 12 DIAS",
        subtitle: "Série Europamundo Oriente medio e Asia ",
        partialPrice: "10.428,24",
        taxesIncluded: true,
        parcel: "12",
        discount: "50% Off",
        attribute: "Itinerario",
        label: "Ver Detalhes",
        link: "Còdigo ST20447",
        isActive: false,
        stars: 5,
        parcelInfo: "parcelInfo",
        more: "Ver mais",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        title: { type: "string" },
        subtitle: { type: "string" },
        partialPrice: { type: "string" },
        taxesIncluded: { type: "boolean" },
        parcel: { type: "string" },
        discount: { type: "string" },
        attribute: { type: "string" },
        label: { type: "string" },
        link: { type: "string" },
        isActive: { type: "boolean" },
        stars: { type: "number" },
        parcelInfo: { type: "string" },
        more: { type: "string" },
    }
}

